import Home from "./component1/Home";
import Thailand from "./candelete/Thailand";
import Korea from "./candelete/Korea";
import NavBar from "./component4/NavBar";
import Mian from "./page/Main";
import PageOne from "./page/PageOne";
import PageTwo from "./page/PageTwo";
import PageThree from "./page/PageThree";
import PageFour from "./page/PageFour";

function App() {
  return (
    <div className="main">
      <div className="brand">
        <img src={image} className="logo" />
        <h2>All in one travel app </h2>
      </div>

      <div>
        <div className="title">
          <img src={image2} className="img2"></img>
